data.text:
@carloscrackk En el mismo lugar que ha estado siempre porque llevais tragando bilis ANOS, y eso no va a cambiar.
Ni en cien anos que vivas llegaras a vivir lo que he vivido yo con mi equipo, y eso es lo que escuece.

Un saludito, que me voy de previa 🙋🏻‍♀️

@sergiomg91 @jeeni_16sfc Estas muy, pero que muy equivocado. 
Los porrazos vienen desde el minuto 1, que entran como becerros sin mediar palabra.
No hay justificacion alguna para ese abuso desmedido, sin sentido alguno, llevandose por delante a todo el mundo sin importar nada ni nadie.
